ACORDE POVO BRASILEIRO! Não estamos vivendo um BIG BROTHER, onde a maioria das pessoas que está fora desse movimento assiste a tudo passivamente, onde muitos caem nas narrativas da MÍDIA PORCA e VENDIDA - descredibilizando esse MOVIMENTO PATRIOTA de milhões de brasileiros em frente aos QUARTÉIS (chamando o movimento de ANTIDEMOCRÁTICO), e outros ficam ACOMODADOS em sua PREGUIÇA e no seu conforto esperando que OS OUTROS LUTEM POR ELES... Se com nosso movimento não revertermos a situação CRIMINOSA, TOTALITÁRIA e ABSURDA que toma conta das instituições brasileiras nesse momento, JÁ ERA! Viraremos uma VENEZUELA e todos padecerão!
👉👉👉🪖🪖🪖🥾🥾🥾

